INSERT INTO "NOTE" VALUES (1, 'Lễ trao bằng tốt nghiệp các lớp Cao cấp Lý luận Chính trị', 'TP HCMPhố đi bộ quận 10 gần 50 gian h​àng ẩm thực, mua sắm, kinh phí đầu tư 2,5 tỷ đồng đón khách từ 18h đến 23h thứ ba tới chủ nhật hàng tuần.', '12-12-2020');
INSERT INTO "NOTE" VALUES (2, 'Lorem Ipsum là gì?', 'Lorem Ipsum” xuất phát từ cụm từ Latin dolorem ipsum , có nghĩa là “pain itself”. Nó là văn bản giả đã được sử dụng từ những năm 1500 như một placeholder cho nội dung', '11-12-2021');
INSERT INTO "NOTE" VALUES (3, 'Công cụ Lorem Ipsum là gì?',  'Công cụ iorum lorem của chúng tôi được tạo ra với sự chú trọng hướng tới nhu cầu của các nhà thiết kế web, quản trị viên web và nhà tiếp thị nội dung','14-12-2020');
INSERT INTO "NOTE" VALUES (4, 'Cách sử dụng công cụ',  'Phó Tổng thống Mike Pence đang lâm vào thế khó xử nhất trong 4 năm nhiệm kỳ, khi Trump và đồng minh đang thúc giục ông chọn phe.', '14-12-2021');
INSERT INTO "NOTE" VALUES (5, 'Lorem ipsum dolor sit amet',  'Chúng tôi muốn cung cấp cho bạn nội dung trợ giúp mới nhất nhanh nhất có thể bằng ngôn ngữ của riêng bạn. Trang này được dịch tự động và có thể chứa lỗi ngữ pháp hoặc không chính xác. Mục đích của chúng tôi là làm cho nội dung này trở nên hữu ích cho bạn', '01-12-2020');
INSERT INTO "NOTE" VALUES (6, 'Nhà thiết kế Pierre Cardin qua đời',  'PHÁPNhà thiết kế lừng danh người Pháp - Pierre Cardin - qua đời ở tuổi 98, tối 29/12 tại Paris.', '05-12-2021');
INSERT INTO "NOTE" VALUES (7, 'Trump được bầu là người đáng ngưỡng mộ nhất tại Mỹ',  'Trump được bầu chọn là Người đàn ông đáng ngưỡng mộ nhất tại Mỹ theo khảo sát của Gallup, kết thúc chuỗi 12 năm sở hữu danh hiệu này của Obama.', '15-12-2022');
INSERT INTO "NOTE" VALUES (8, 'Phân công nhiệm vụ cho lãnh đạo Hà Nội',  'Ông Chu Ngọc Anh sẽ lãnh đạo, quản lý toàn diện mọi hoạt động thuộc chức năng, nhiệm vụ, quyền hạn của UBND thành phố, Chủ tịch UBND thành phố.', '16-12-2021');
INSERT INTO "NOTE" VALUES (9, 'Sắp có chuẩn nghèo mới',  'Chuẩn nghèo giai đoạn 2021-2025 dự kiến 1,5 triệu đồng/người/tháng với khu vực nông thôn và 2 triệu đồng mỗi tháng khu vực thành thị. ', '17-01-2021');
INSERT INTO "NOTE" VALUES (10, 'Đường di chuyển của 6 người vượt biên',  'Vượt biên vào An Giang rạng sáng 24/12, 6 người thuê ôtô chở về TP HCM, trong đó đôi nam nữ đã xuống xe tại Long An. Hiện 4 người đã dương tính nCoV.  26 ', '10-11-2020');
INSERT INTO "NOTE" VALUES (11, 'Cựu phó chánh án quận 4 muốn bạn khai thật', 'TP HCMBị cáo Nguyễn Hải Nam, nguyên phó chánh án quận 4, yêu cầu Lâm Hoàng Tùng "khai thật" để tránh mất thời gian vì sự thật khác với lời khai của người này. ', '14-12-2020');
INSERT INTO "NOTE" VALUES (12, 'Cuộc vây bắt nghẹt thở nhóm người chở 51kg vàng lậu vào Việt Nam', 'Bốn người chạy xuồng máy, chở hai bao tải đựng 51kg vàng từ Campuchia vào TP Châu Đốc, chống trả quyết liệt khi bị cảnh sát vây bắt.', '16-12-2020');
INSERT INTO "NOTE" VALUES (13, 'Những sai lầm tiền bạc khiến tài chính của bạn bị vắt kiệt',  'Cố chi tiêu cho bằng bạn bè, sản phẩm nào cũng mua hàng mới và trả lãi thẻ tín dụng hàng tháng sẽ vắt kiệt tài chính của bạn.', '30-12-2020');
INSERT INTO "NOTE" VALUES (14, '10 quốc gia thu hút nhiều sinh viên Mỹ nhất',  'Các nhà sản xuất linh kiện cho Samsung Galaxy S21 bắt đầu đơn hàng làm dấy lên tin đồn rằng model này sẽ sớm ra mắt trong năm nay.', '31-12-2020');
INSERT INTO "NOTE" VALUES (15, 'Năm câu đố tìm điểm khác biệt',  'Trong mỗi bức tranh có một chi tiết bất hợp lý, được lồng ghép khéo léo, liệu bạn có thể tìm ra trong 10 giây? ', '02-01-2020');
INSERT INTO "NOTE" VALUES (16, 'Bác sĩ già chiến thắng ung thư nhờ văn chương và hội họa',  'TRUNG QUỐCBác sĩ Thường Cửu, 76 tuổi, ở Nam Sơn, Thâm Quyến, vượt qua nhiều bệnh nan y nhờ tinh thần "ung', '12-01-2021');
INSERT INTO "NOTE" VALUES (17, 'Siêu thực phẩm mùa đông theo cổ truyền Trung Quốc',  'Củ cải, khiếm thực tức củ của cây hoa súng, táo đỏ là ba "siêu thực phẩm" trong mùa đông theo quan niệm ... ', '6-01-2021');
INSERT INTO "NOTE" VALUES (18, 'Giáng sinh buồn của những gia đình nạn nhân Covid-19',  'MỸAbel Bautista nghĩ Giáng sinh sẽ rất ảm đạm nhưng hóa ra, ngày trước đó mới thật sự nặng nề. ', '12-02-2021');
INSERT INTO "NOTE" VALUES (19, 'Có nên cấm bé trai chơi búp bê?',  'Nhiều cha mẹ không cho con trai chơi búp bê, vì sợ con trở nên nữ tính, yếu đuối. Đó có phải là sự thật không?  14', '15-01-2020');
INSERT INTO "NOTE" VALUES (20, 'Phát hiện 591 ngôi sao tốc độ cao',  'Các ngôi sao di chuyển với tốc độ từ 65 - 100 km/s và có thể thoát khỏi thiên hà của chúng trong tương lai.  ', '19-01-2020');
INSERT INTO "NOTE" VALUES (21, 'Ứng dụng công nghệ để mỗi người dân một bác sĩ',  'Việc tiên phong ứng dụng công nghệ và mô hình mới như khám chữa bệnh từ xa được đánh giá sẽ giúp người dân tiếp cận các dịch vụ y tế theo nhu cầu.  10', '17-02-2021');
INSERT INTO "NOTE" VALUES (22, '42 người tiếp xúc gần bệnh nhân 1453 âm tính nCoV', '42 trường hợp tiếp xúc gần nam bệnh nhân vượt biên về quận 9, TP HCM, sáng 30/12 xét nghiệm âm tính nCoV, 10 người đợi kết quả.', '09-03-2021');
INSERT INTO "NOTE" VALUES (23, 'Hàng loạt lãnh đạo Công ty nông nghiệp Hoàng Anh Gia Lai từ chức', '3 thành viên Hội đồng quản trị và Trưởng ban kiểm soát của HAGL Agrico đã nộp đơn xin từ chức trước phiên họp ', '03-04-2021');
INSERT INTO "NOTE" VALUES (24, 'Khởi tố vụ án nhóm nhập cảnh trái phép nhiễm nCoV',  'AN GIANGCơ quan an ninh điều tra xác định một số người trong và ngoài nước tổ chức đường dây đưa "bệnh nhân 1440" cùng 5 người khác nhập cảnh trái phép.  13', '06-02-2021');
INSERT INTO "NOTE" VALUES (25, '2020 - năm thách thức của bất động sản thương mại',  'Mặt bằng bán lẻ bị tác động ngay khi đại dịch bùng phát, giá thuê lao dốc, nguồn cung mới dạt ra vùng ven.  ', '05-05-2021');
INSERT INTO "NOTE" VALUES (26, 'Trung Quốc đặt cược vào chiến lược chống Covid-19 mới',  'Khi các cụm dịch mới xuất hiện ở ngoại ô Bắc Kinh hay Liêu Ninh, giới chức Trung Quốc không còn ra lệnh phong tỏa toàn diện như hồi đầu năm.  ', '11-12-2020');
INSERT INTO "NOTE" VALUES (27, 'Trung Quốc tuyên án tù 10 người Hong Kong đào tẩu',  'Tòa án Trung Quốc tuyên án tù đối với 10 trong số 12 người Hong Kong đào tẩu, trong khi hai trẻ vị thành niên được đưa về Hong Kong. ', '26-12-2020');
INSERT INTO "NOTE" VALUES (28, 'Rác tràn ra đường ngày cuối năm',  'HÀ NỘIHơn 100 tấn rác tồn đọng, chồng chất tại các điểm thu gom, vỉa hè ở quận Nam Từ Liêm. ', '29-12-2020');
INSERT INTO "NOTE" VALUES (29, 'Siết chặt vùng biên',  'Sau khi bốn người vượt biên mắc Covid-19, các tỉnh vùng biên giới tăng cường kiểm soát, ngăn chặn tình trạng nhập cảnh trái phép. ', '30-12-2020');
INSERT INTO "NOTE" VALUES (30, 'Mỹ và EU yêu cầu Trung Quốc thả nhà báo đưa tin Vũ Hán',  'Mỹ và EU yêu cầu Trung Quốc lập tức thả nhà báo đưa tin dịch bệnh Covid-19 ở Vũ Hán sau khi cô bị tuyên án 4 năm tù. ', '31-12-2020');
